for cidx, collection in enumerate(collections, 1):
    for i in range(num_requests):
        offset = i * 20
        url = collection["base_url"] + f"&offset={offset}"
        try:
            response = requests.get(url, headers=collection["headers"])
            data = response.json()
            items = data.get("actions")
            if items:
                for item in items:
                    nft = item.get("nft", {})
                    attributes = nft.get("attributes", [])
                    cur.execute("""
                        INSERT INTO items (name, model, backdrop, amount, floor_price, photo_url, created_at)
                        VALUES (?, ?, ?, ?, ?, ?, ?)
                    """, (
                        nft.get("name"),
                        get_attribute(attributes, "model"),
                        get_attribute(attributes, "backdrop"),
                        item.get("amount"),
                        nft.get("floor_price"),
                        nft.get("photo_url"),
                        item.get("created_at")
                    ))
                conn.commit()
                print(f"[Коллекция {cidx}] offset={offset}: данные сохранены.")
            else:
                print(f"[Коллекция {cidx}] offset={offset}: нет данных.")
            time.sleep(delay)
        except Exception as e:
            print(f"[Коллекция {cidx}] offset={offset}: ошибка: {e}")

conn.close()
